import React from "react";
import { Stack } from "@chakra-ui/react";

const Footer = () => {
  return (
    <Stack
      textAlign="center"
      justify="center"
      bg="black"
      paddingY={4}
      as="footer"
    >
    </Stack>
  );
};

export default Footer;
